import Post from "./Post";

export default function PostList({ posts = [] , dispatch}) {
  return (
    <div style={{padding: '3% 5%'}}>
      {posts.map((p, i) => (
        <Post {...p} key={p.id} style={{padding: '3% 5%'}} dispatch={dispatch}/>
      ))}
    </div>
  );
}
